import { React, useEffect } from 'react';

/**
 * Match History Component
 * 
 * @author Ben Kelly w19014367
 */

export default function MatchHistory({  }) {

    useEffect(() => {
        fetch('http://unn-w19014367.newnumyspace.co.uk/kickbuddy/api/matchhistory')
            .then(response => response.json())
            .then(
                (json) => {
                    setMatches(json.data);
                    setLoading(false);
                }
            )
            .catch(
                (e) => {
                    console.log(e.message);
                    setLoading(false);
                }
            )
    });

    return(
        <div className='matchHistory-contents'>
            <p><strong>Games: </strong>{gamesPlayed}</p>
            <p><strong>Wins: </strong>{wins}</p>
            <p><strong>Draws: </strong>{draws}</p>
            <p><strong>Losses: </strong>{losses}</p>
            <p><strong>Goals: </strong>{goals}</p>
            <p><strong>Assists: </strong>{assists}</p>
            <p><strong>Avg Rating: </strong>{avgRating}</p>
        </div>
    )

}
